    # The table format is:
    # [ X, Y, ke_pos, work_pos, disp_pos, pint_pos, pint_neg, z_pos,  z_neg,
    #       qint_pos, ovp_min,  z_ovp_min ]
    # where
    #  X = ln(lambda) where lambda = scaled range
    #  Y = ln(ovp_ratio) 
    #  ke_pos = kinetic energy in positive phase of the wave
    #  work_pos = work of positive phase of the wave
    #  disp_pos = peak displacement of a lagrange point in the positive phase of the wave
    #  pint_pos = r**(n/2) x positive phase overpressure impulse, where n=0,1,2 is the symmetry
    #  pint_neg = r**(n/2) x negative phase overpressure impulse, where n=0,1,2 is the symmetry
    #  z_pos = z value at end of positive phase
    #  z_neg = z value at end of negative phase, if any
    #  qint_pos = dynamic pressure impulse = integral of rho*u**2
    #  ovp_min = minimum overpressure ratio at this location
    #  z_ovp_min = z value at minimum overpressure ratio 


